// Parent - Main.js


import React from "react";

import Box from "@mui/material/Box";
import Skeleton from "@mui/material/Skeleton";

import classes from "../../ui/SwiperSlideUI.module.css";

function BodySkeleton() {
  return (
    <div style={{ display: 'inline'}}>
      <Skeleton
        height={250}
        width="20%"
        animation="wave"
        variant="rectangular"
      />
      <Skeleton
        height={250}
        width="20%"
        animation="wave"
        variant="rectangular"
      />
      <Skeleton
        height={250}
        width="20%"
        animation="wave"
        variant="rectangular"
      />
      <Skeleton
        height={250}
        width="20%"
        animation="wave"
        variant="rectangular"
      />
      <Skeleton
        height={250}
        width="20%"
        animation="wave"
        variant="rectangular"
      />
    </div>
  );
}

export default BodySkeleton;
